import './App.css';
import Signup from './Components/Signup/Signup';

function App() {
  return (
    <div className="App">
      <Switch>
        <Route path="/" component={Home} exact/>
        <Route path="/Product" component={Product} exact/>
        <Route path="/" component={Signup} exact/>
        <Route path="/Cart" component={Home} exact/>

      </Switch>
    </div>
  );
}

export default App;
